import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";

function CardApp() {
    return (
        <div>
            <Card
                url="https://pbs.twimg.com/profile_images/1091091004701040640/HxMUqWiO_400x400.jpg"
                name="Lil Kelv"
                phoneNum="911"
                email="lilkelv@gmail.gov"
            />
        </div>
    );
}

export default CardApp;
